import React, { useEffect, useState } from 'react'
import axios from 'axios';
import './Userprofilestyle.css';
import { useNavigate } from 'react-router-dom';


function Userlist() {
    const [data, setData] = useState([])
    
    const viewallfn=()=>{
        axios.post("http://127.0.0.1:8080/findalluser")
        .then((result)=>{
            console.log(result)
            setData(result.data.data)
        })
        .catch((error)=>{
            console.log(error)
        })
        
    }
    useEffect(()=>{
        viewallfn();
    },[])

    const nvar=useNavigate()

    const viewoneuser=()=>{
        axios.post("http://127.0.0.1:8080/viewuser/:id",data)
        // .then((result)=>{
        //     console.log(result)
        //     setData(result.data.data)
        // })
        // .catch((error)=>{
        //     console.log(error)
        // })
    }
    const updateuser=(id)=>{
        axios.post("http://127.0.0.1:8080/updateuser/",id)
        .then((result)=>{
            console.log(result)
            setData(result.data.data)
        })
        .catch((error)=>{
            console.log(error)
        })
    }
    const deleteuser=(id)=>{
        axios.post("http://127.0.0.1:8080/deleteuser/"+id)
        console.log(id)
        .then((result)=>{
            console.log(result)            
        })
        .catch((error)=>{
            console.log(error)
        })
    }
    
  return (
    <div>
        <div className="userlist">
        <center>    
                <h2>User List</h2><br/>
                <div>                    
                      <table border={1}>
                          <thead>
                              <tr>
                                  <th>Sl.No</th>
                                  <th>Name </th>
                                  <th>Type of Employement</th>
                                  <th>Age</th>
                                  <th>Employee ID</th>
                                  <th>Email</th>
                                  <th>Password</th>
                                  <th>Options</th>
                              </tr>
                          </thead>

                        {
                            data.length > 0 ?
                            data.map((item, index)=>(
                                <tbody key={index}>
                                    <tr>
                                        <td>{index + 1}</td>
                                        <td>{item.empname}</td>
                                        <td>{item.typeofemp}</td>
                                        <td>{item.age}</td>
                                        <td>{item.empid}</td>
                                        <td>{item.email}</td>
                                        <td>{item.password}</td>
                                        <td><button onClick={()=>{viewoneuser(item._id)}}>View</button>&nbsp;
                                        <button onClick={()=>{updateuser(item._id)}}>Update</button>&nbsp;
                                        <button onClick={()=>{deleteuser(item._id)}}>Delete</button></td>
                                    </tr>
                                </tbody>
                            )):<h3>No data found</h3>
                        }   
                      </table>

                </div>
            </center>
        </div>
    </div>
  )
}

export default Userlist
